import styled from 'styled-components';

const Container = styled.div`
	display: flex;
	flex: 1;
	img {
		height: 8rem;
		width: 8rem;
	}
	border-left: 1px solid #454545;
`;

const Text = styled.div`
	width: 20rem;
`;

const FooterLogo = styled.div`
	display: flex;
	align-items: center;
`;
export { Container, FooterLogo, Text };
